import React from 'react'
import { Routes, Route } from "react-router-dom"
import { NavBar } from './NavBar'
import { HomePage } from '../Home'
import { ProfilePage } from '../Profile'

export const MainPagesContainer = (props) => {
    const pages = [{
      name: "Home",
      relativePath: "/home",
      element: <HomePage />
    },{
      name: "My Profile",
      relativePath: "/profile",
      element: <ProfilePage />
    }]

    const deleteToken = () => {
      sessionStorage.removeItem("userToken");
  }

    const routes = pages.map((page, index) => <Route path={page.relativePath} element={page.element} key={index}/>);

    // Manually add Lougout page
    pages_list.push(<li key={0} onClick={deleteToken}><NavBarItem name="Logout" relativePath="/"></NavBarItem></li>)
    return(
      <>
        <NavBar pages={pages} />
        <Routes>
          {routes}
        </Routes>
      </>
    )
  }
